import React from "react";
import ReactDOM from "react-dom";
import Register from "./Register";
import Login from "./Login";
import  { Redirect } from 'react-router-dom'




function Home() {
  function login(){
    <Link to="/Login"></Link>
  }
  function register(){
    <Link to="/Register"></Link>
  }
return( 
  <div>
    <link rel="stylesheet" href="https://use.fontawesome.com/releases/v5.6.3/css/all.css" integrity="sha384-UHRtZLI+pbxtHCWp1t77Bi1L4ZtiqrqD80Kn4Z8NTSRyMA2Fd33n5dQ8lWUE00s/" crossorigin="anonymous"/>
      <link rel="stylesheet" href="https://stackpath.bootstrapcdn.com/bootstrap/4.2.1/css/bootstrap.min.css" integrity="sha384-GJzZqFGwb1QTTN6wy59ffF1BuGJpLSa9DkKMp0DgiMDm4iYMj70gZWKYbI706tWS" crossorigin="anonymous"/>
      <link rel="stylesheet" href="css/styles.css"/>
<div class="jumbotron centered">
  <div class="container">
    <i class="fas fa-key fa-6x"></i>
    <h1 class="display-3">Notes Keeper</h1>
    <p class="lead">Your notes are safe here.</p>
    <hr/>
    <a class="btn btn-light btn-lg" onClick={register} role="button">Register</a>
    <a class="btn btn-dark btn-lg" onClick={login} role="button">Login</a>

  </div>
</div>
</div>
 );

}
export default Home;
